Description: This is the 100th episode of Comedy Nights with Kapil. The show starts with Guthi speaking about a special performance on the occasion of the show completing 100 episodes. The curtains lift and Bittoo is ready to sing a qawali with his family and neighbors. The special qawali has the audience in splits with laughter. Kapil then announces the completion of 100 episodes. As he is speaking, Kapil's father-in-law and brother-in-law walk to celebrate with the family. Kapil asks them to leave when his wife, Manju walks on to the stage. Inspector Shamsher Singh walks on to the stage and speaks about the hardships that police have to face in their line of duty. As he speaking, Kareena Kapoor Khan walks in and joins Shamsher Singh on the stage. Kareena says that she has come to meet Singham. Ajay Devgan walks in on the stage and is welcomed by Sidhu in his traditional way. Watch the show and have fun as Ajay Devgan and Kareena Kapoor Khan promote their upcoming movie, Singham Returns.

